import Grid, { GridItem } from "./layout/Grid";
import logo from "../assets/logo.svg";
import l4G from "../assets/I4G.svg";
import "../styles/footer.css";
import Flex from "./layout/Flex";

const Footer = () => {
  return (
    <div
      className="footer-position footer-padding bordered"
      style={{ position: "relative" }}
    >
      <div
        className="bordered"
        // style={{
        //   position: "absolute",
        //   top: "0",
        //   left: "112px",
        //   right: "112px",
        // }}
      ></div>
      <Grid span={12} gap="12px">
        <GridItem span={3} md={12} className="">
          <div>
            <img src={logo} alt="" />
          </div>
        </GridItem>
        <GridItem span={7} md={12} className="">
          <div className="text-pos">
            <p>HNG Internship 9 Frontend Task</p>
          </div>
        </GridItem>
        <GridItem span={2} md={12} className="">
          <div className="logo-position">
            <img src={l4G} alt="" />
          </div>
        </GridItem>
      </Grid>
    </div>
  );
};

export default Footer;
